method: {description: "Indexing corpora to ChatNoir with the ir-datasets indexer is a three step process where (1) the corpus is uploaded to an remote object storage, (2) document offsets are extracted for random document offset, and (3) documents are indexed to an remote ElasticSearch cluster.\n\nThis process conducted step three and indexed the documents into ChatNoir.\n\nThe tracked resources only incorporate the local execution environment, i.e., the resources that the ElasticSearch client consumes. The resources of the ElasticSearch cluster are not as this is a remote service. Details on the ElasticSearch cluster are available at https://webis.de/facilities.html (i.e., at the moment, the ElasticSearch uses the betaweb cluster with 130 servers.)", name: "ChatNoir (Index to ElasticSearch)"}
